TASHKENT Jan 23, (APP): Foreign Minister Bilawal Bhutto Zardari Monday held a meeting with Foreign Minister of Tajikistan Sirojiddin Muhriddin here.
The two ministers expressed satisfaction on recent high engagements and agreed to further enhance the existing excellent bilateral relations and economic cooperation especially in trade, energy and connectivity.
